import math

def threeEqualParts(arr):
     num=0 
     n=len(arr)
     powers=[0]*n
     for x in range(0, n):
         if arr[x] == 1:
             num+=1<<(n-x-1)
         powers[x]=1<<x
     if  num == 0:
         return [0, n-1]

     #count=0
     #i=0
     for u in range(n-1, -1, -1):
         for l in range(0, u):
             d=num%(powers[u]+powers[l]+1)
             if d==0:
                 print("SIR")

